&lt;p&gt;In the question a statement is given, followed by two arguments, I and II. You have to consider the statement to be true even if it seems to be at variance from commonly known facts. You have to decide which of the given arguments, if any, is a strong argument.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Statement: &lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;Should eating Paan at public places be made punishable?&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Argument I:&lt;/strong&gt;&amp;nbsp;Yes, people eat Paan and spit and makes public places dirty.&amp;nbsp;&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Argument II:&lt;/strong&gt;&amp;nbsp;No, Indians love Paan.&lt;/p&gt;

hn.value:
&lt;p&gt;प्रश्न में एक कथन दिया गया है, उसके बाद I और II से अंकित दो तर्क दिए गए हैं। आपको कथन को सत्य मानना है, भले ही वह ज्ञात तथ्यों से भिन्न प्रतीत हो। आपको यह निर्णय करना होगा कि दिए गए तर्कों में से कौन सा तर्क, यदि कोई है, तो एक प्रबल तर्क है।&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;कथन&lt;/strong&gt;&lt;strong&gt;:&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;सार्वजनिक स्थानों पर पान खाना दंडनीय बनाया जाना चाहिए?&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;तर्क&lt;/strong&gt;&lt;strong&gt; I:&lt;/strong&gt; हाँ, लोग पान खाते हैं और थूकते हैं और सार्वजनिक स्थानों को गंदा बनाते हैं।&lt;/p&gt;
&lt;strong&gt;तर्क II:&lt;/strong&gt; नहीं, भारतीय पान को पसंद करते हैं।

